import React, { useState } from 'react';


const Diet = () => {
  const [selectedMeal, setSelectedMeal] = useState('breakfast');
  
  const dietPlan = {
    breakfast: {
      time: '7:00 AM',
      foods: [
        { item: '1 cup oatmeal with berries', calories: 150 },
        { item: '1 glass low-fat milk', calories: 100 },
        { item: '1 banana', calories: 90 },
        { item: 'Green tea', calories: 10 }
      ],
      totalCalories: 350
    },
    lunch: {
      time: '12:30 PM',
      foods: [
        { item: 'Grilled chicken salad', calories: 200 },
        { item: '1 cup brown rice', calories: 150 },
        { item: 'Mixed vegetables', calories: 80 },
        { item: '1 glass water', calories: 0 }
      ],
      totalCalories: 430
    },
    dinner: {
      time: '7:00 PM',
      foods: [
        { item: 'Baked salmon', calories: 180 },
        { item: 'Steamed broccoli', calories: 30 },
        { item: '1 small sweet potato', calories: 100 },
        { item: 'Herbal tea', calories: 5 }
      ],
      totalCalories: 315
    }
  };

  const dailyGoals = {
    calories: { current: 1095, target: 1400 },
    protein: { current: 65, target: 80 },
    carbs: { current: 150, target: 180 },
    fat: { current: 45, target: 60 }
  };

  return (
    <div className="space-y-6">
      <div className="bg-white/80 backdrop-blur-lg rounded-xl p-6 border border-primary-200 shadow-lg">
        <div className="flex items-center space-x-2 mb-4">
                     <span className="text-primary-700 text-2xl">üçΩÔ∏è</span>
          <h3 className="text-xl font-bold text-primary-900">Personalized Diet Chart</h3>
        </div>
        
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-6">
          <div className="lg:col-span-2">
            <div className="flex space-x-2 mb-4">
              {Object.keys(dietPlan).map(meal => (
                <button
                  key={meal}
                  onClick={() => setSelectedMeal(meal)}
                  className={`px-4 py-2 rounded-lg font-medium capitalize transition-colors ${
                    selectedMeal === meal
                      ? 'bg-primary-600 text-white'
                      : 'bg-primary-100 backdrop-blur-sm text-primary-700 hover:bg-primary-200'
                  }`}
                >
                  {meal}
                </button>
              ))}
            </div>

            <div className="bg-primary-50 backdrop-blur-sm rounded-lg p-6 border border-primary-200">
              <div className="flex justify-between items-center mb-4">
                <h4 className="font-semibold text-primary-900 capitalize">{selectedMeal} ({dietPlan[selectedMeal].time})</h4>
                <span className="text-sm text-primary-600 font-medium">
                  {dietPlan[selectedMeal].totalCalories} calories
                </span>
              </div>
              <div className="space-y-2">
                {dietPlan[selectedMeal].foods.map((food, index) => (
                  <div key={index} className="flex justify-between items-center py-2 border-b border-primary-200 last:border-b-0">
                    <span className="text-primary-900">{food.item}</span>
                    <span className="text-sm text-primary-600">{food.calories} cal</span>
                  </div>
                ))}
              </div>
            </div>
          </div>
          
          <div className="space-y-4">
            <div className="bg-primary-50 backdrop-blur-sm rounded-lg p-4 border border-primary-200">
              <div className="flex items-center space-x-2 mb-3">
                                 <span className="text-primary-700">üéØ</span>
                <h4 className="font-semibold text-primary-900">Daily Goals</h4>
              </div>
              <div className="space-y-3">
                {Object.entries(dailyGoals).map(([nutrient, data]) => (
                  <div key={nutrient}>
                    <div className="flex justify-between text-sm mb-1">
                      <span className="capitalize text-primary-900">{nutrient}</span>
                      <span className="font-medium text-primary-600">{data.current}/{data.target}</span>
                    </div>
                    <div className="w-full bg-primary-200 rounded-full h-2">
                      <div
                        className="bg-primary-600 h-2 rounded-full transition-all duration-300"
                        style={{ width: `${Math.min((data.current / data.target) * 100, 100)}%` }}
                      ></div>
                    </div>
                  </div>
                ))}
              </div>
            </div>
            
            <div className="bg-primary-50 backdrop-blur-sm rounded-lg p-4 border border-primary-200">
              <h4 className="font-semibold text-primary-900 mb-3">Quick Add</h4>
              <div className="space-y-2">
                                 <button className="w-full text-left p-3 bg-blue-600 text-white rounded border border-blue-700 hover:bg-blue-700 transition-colors flex items-center space-x-2 font-semibold">
                    <span className="text-primary-700">‚ûï</span>
                    <span>Log meal</span>
                  </button>
                                 <button className="w-full text-left p-3 bg-primary-100 backdrop-blur-sm rounded border border-primary-200 hover:bg-primary-200 transition-colors flex items-center space-x-2">
                    <span className="text-primary-700">‚ûï</span>
                    <span>Add snack</span>
                  </button>
                                 <button className="w-full text-left p-3 bg-primary-100 backdrop-blur-sm rounded border border-primary-200 hover:bg-primary-200 transition-colors flex items-center space-x-2">
                    <span className="text-primary-700">‚ûï</span>
                    <span>Water intake</span>
                  </button>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Diet;
